import React from 'react';

import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import Page from './utilities/Page';
import ULogo from './utilities/ULogo';
import UTextInput from './utilities/UTextInput';
import UButton from './utilities/UButton';

import './../style/LoginStyle.css';
import ULink from './utilities/ULink';

export default () => {
    const hereLink = <ULink to='/register'>here</ULink>;
    return (
        <Page>
            <Row>
                <Col lg={8}>
                    <Row className='mb-3'>
                        <Col className='ml-auto' lg={7}>
                            <span className='welcome-title'>
                                <strong>Welcome back to</strong> Unite3D
                            </span>
                        </Col>
                    </Row>
                    <Row>
                        <Col className='ml-auto' lg={7}>
                            <UTextInput onClick={() => {}} placeholder='Email' />
                        </Col>
                    </Row>
                    <Row>
                        <Col className='ml-auto' lg={7}>
                            <UTextInput onClick={() => {}} placeholder='Password' />
                        </Col>
                    </Row>
                    <Row className='mb-3'>
                        <Col className='ml-auto' lg={7}>
                            <UButton>Login</UButton>
                        </Col>
                    </Row>
                    <Row>Need an account? Register&nbsp; {hereLink}</Row>
                </Col>
                <Col lg={4}>
                    <ULogo height={'400px'} color='purple' />
                </Col>
            </Row>
        </Page>
    );
};
